function sleep (ms) {
	return new Promise (resolve => setTimeout (resolve, ms));
}
export async function GetPrediction (model, sample)
{
	if (model == null)
		return -1;
	if (sample == null)
		return -2;
	await sleep (0);
	return Math.round (Math.random() * 100) / 100;
}
